import React, { useState, useEffect } from 'react';
import './estilos/Registro.css'; 

const Registro = () => {
  const [tipoUsuario, setTipoUsuario] = useState(null);
  useEffect(() => {
    const tipo = localStorage.getItem('tipoUsuario');
    setTipoUsuario(tipo);
  }, []);
  return (
    <div>
      {tipoUsuario === 'Cliente' && (
        <form>
          {/* Campos de registro de usuario común */}
          <label>Nombre:</label>
          <input type="text" />
          <label>Apellido:</label>
          <input type="text" />
          <label>Fecha de Nacimiento:</label>
          <input type="date" />
          <label>Telefono:</label>
          <input type="number" />
          <label>Email:</label>
          <input type="email" />
          <label>Direccion:</label>
          <input type="text" />
          <label>Contraseña:</label>
          <input type="password" />
          <label>Confirme Contraseña:</label>
          <input type="password" />
        </form>
      )}
      {tipoUsuario === 'profesional' && (
        <form>
          {/* Campos de registro de usuario profesional */}
          <label>Nombre:</label>
          <input type="text" />
          <label>Apellido:</label>
          <input type="text" />
          <label>Fecha de Nacimiento:</label>
          <input type="date" />
          <label>Telefono:</label>
          <input type="text" />
          <label>Email:</label>
          <input type="email" />
          <label>Direccion:</label>
          <input type="text" />
          <label>Contraseña:</label>
          <input type="password" />
          <label>Confirme Contraseña:</label>
          <input type="password" />
          <label>Rubro:</label>
          <select>
          <option value="">Selecciona un rubro</option>
          </select>
          <label>Nombre de la Empresa(opcional):</label>
          <input type="text"/>
          </form>
      )}
    </div>
  );
};
export default Registro;
